import React from 'react';
import './App.css';

function getMeals() {
  console.log("this works")
}

function App() {
  return (
    <div className="App">
      <form onSubmit={getMeals()}>
        <h1>Generate Meal Plan</h1>
        <label for="duration">Duration </label>
        <input type="radio" id="day" name="duration" value="day"/>
        <label htmlFor="day">Day </label>
        <input type="radio" id="week" name="duration" value="week"/>
        <label htmlFor="week">Week </label>
        <label for="calories">Target Calories </label>
        <input type="number" min="1"/>
        <label for="diet">Diet </label>
        <input type="text" id="diet" placeholder="Vegetarian, Keto..."/>

        <button type="submit">Get Meal Plan</button>
      </form>

      <div id="results">

      </div>
    </div>
  );
}

export default App;
